def func(text,target):
    def addPlus(text,target,indexes):
        ind = 0
        for i in indexes:
            text = text[0:i+ind] + "+" + text[i+ind:]
            ind += 2
        if eval(text)==target:
            print(f"{text}={target}")
    def calc(n,text,target,indexes=[], a=1, b=len(text)):
        for i in range(a,b):
            if b==n:
                addPlus(text,target,indexes+[i])
            else:
                calc(n,text,target,indexes+[i],i,b-1)
    for n in range(len(text),1,-1):
        calc(n,text,target)
        
