struct Stats {
    map<string, int> word_frequences;

    void operator += (const Stats& other) {
        
        for (auto [word, frequence] : other.word_frequences) {
            word_frequences[word] += frequence;
        }

    }
};


vector<string> SpliteLine(const string& Line) {

    istringstream ss(Line);
    return { istream_iterator<string> (ss),istream_iterator<string> () };
}

template<typename ContainerOfVectors>
Stats SplitLines(const ContainerOfVectors& Lines, const set<string>& key_words) {
    
    Stats Result;

    for (const string& Line : Lines) {

        for (const string& WordFromLine : SpliteLine(Line)) {
            if (key_words.count(WordFromLine)) { ++Result.word_frequences[WordFromLine]; }
        }

    }

    return Result;
}

Stats ExploreKeyWords(const set<string>& key_words, istream& input) {

    Stats Result;

    vector<string> SplitText;

    for (string tmp; getline(input, tmp); ) {SplitText.push_back(move(tmp));}

    vector<future<Stats>> Futures; Futures.reserve(8);

    // Paginate(SplitText, 4 + SplitText.size() / 4) == 
    //                      { {SplitText.begin(), SplitText.begin() + N}, ..., { SplitText.begin() + K * N, SplitText.end() }}
    // ItRanges == {SplitText.begin() + L, SplitText.begin() + T} : L < T
    for (const auto & ItRanges : Paginate(SplitText, 4 + SplitText.size() / 4)) {

        Futures.push_back(async([=]() {
            return SplitLines(ItRanges, key_words);
            }));
    }

    for (auto& fut : Futures) { 
        Result += fut.get();
    }

    return Result;
}

