//Static object
class Picture : public Drawable {
protected:
    sf::Texture texture;
    sf::Sprite sprite;
public:
    Picture(sf::Texture &texture) : texture(texture){
        sprite.setTexture(texture);
    }

    Picture(std::string storage_address) {
        texture.loadFromFile(storage_address);
        sprite.setTexture(texture);
    }

    void setTexture(sf::Texture &texture) {
        this->texture.swap(texture);
        sprite.setTexture(texture);
    }

    void setPosition(double x, double y){
        sprite.setPosition(x, y);
    }

    void draw(RenderTarget &window, RenderStates) const override {
        window.draw(sprite);
    }
};

//Dynamic object
class Animation : public Picture {
private:
    IntRect rectSourceSprite;
    IntRect originalRectSourceSprite;

    int xFramesAmount; // amount of horizontal frames
    Vector2i lastFrameCoords;

    Clock clock;
public:
    Animation(sf::Texture &animation_texture, IntRect rectSourceSprite,
        int xFramesAmount, Vector2i lastFrameCoords) : Picture(animation_texture)
    {
        this->xFramesAmount = xFramesAmount;
        this->lastFrameCoords = lastFrameCoords;

        this->rectSourceSprite = rectSourceSprite;
        originalRectSourceSprite = rectSourceSprite;

        sprite.setTextureRect(rectSourceSprite);
    }
    
    Animation(std::string storage_address, IntRect rectSourceSprite,
        int xFramesAmount, Vector2i lastFrameCoords) : Picture(storage_address)
    {
        this->xFramesAmount = xFramesAmount;
        this->lastFrameCoords = lastFrameCoords;

        this->rectSourceSprite = rectSourceSprite;
        originalRectSourceSprite = rectSourceSprite;

        sprite.setTextureRect(rectSourceSprite);
    }

    void draw(RenderTarget &window, RenderStates) const override {
        window.draw(sprite);
    }

    void update() {
        if (rectSourceSprite.top == lastFrameCoords.x && rectSourceSprite.left == lastFrameCoords.y)
            rectSourceSprite = originalRectSourceSprite;

        while (clock.getElapsedTime().asSeconds() < 0.11) {}
        if (rectSourceSprite.left == originalRectSourceSprite.left * (xFramesAmount - 1)) {
            rectSourceSprite.left = 0;
            rectSourceSprite.top += originalRectSourceSprite.height;
        }
        else
            rectSourceSprite.left += originalRectSourceSprite.left;

        sprite.setTextureRect(rectSourceSprite);
        clock.restart();
    }

};

int main()
{
    RenderWindow window(VideoMode(900, 900), "BOBR");
    IntRect rectSourceSprite(360, 0, 360, 360);

    sf::Image icon;
    icon.loadFromFile("Resources/bobr_icon.png");
    window.setIcon(31, 32, icon.getPixelsPtr());

    Picture picture("Resources/bobr_picture.png");
    Animation animation("Resources/bobr_animation.png", rectSourceSprite, 10, {3240, 3240});

    animation.setPosition(270, 420);
    picture.setPosition(210, 50);

    while (window.isOpen()) {
        Event event;    

        while (window.pollEvent(event)) {
            if (event.type == Event::Closed)
                window.close();
        }

        animation.update();

        window.clear(BG_COLOR);
        window.draw(picture);
        window.draw(animation);
        window.display();
    }
    return 0;
}

