#include <bits/stdc++.h>
#include <ext/pb_ds/assoc_container.hpp>

#define int int64_t

#define rng(i, a, b) for (int i = a; i < b; i++)
#define rep(i, b) rng(i, 0, b)
#define gnr(i, a, b) for (int i = b - 1; i >= a; i--)
#define per(i, b) gnr(i, 0, b)

#define all(x) begin(x), end(x)
#define sz(x) int(size(x))

#define pb push_back
#define eb emplace_back
#define lb lower_bound
#define ub upper_bound

#define f first
#define s second

using namespace std;
using namespace __gnu_pbds;

void solve() {
    int n;
    cin >> n;
    vector<pair<int, int>> p(n);
    for (auto &[y, x] : p) {
        cin >> y >> x;
    }

    vector<int> dy, dx;
    rep(i, n) {
        dy.pb(p[i].f);
        dx.pb(p[i].s);
    }
    sort(all(dy));
    dy.resize(unique(all(dy)) - dy.begin());
    sort(all(dx));
    dx.resize(unique(all(dx)) - dx.begin());
    rep(i, n) {
        p[i].f = lb(all(dy), p[i].f) - dy.begin();
        p[i].s = lb(all(dx), p[i].s) - dx.begin();
    }
    sort(all(p));

    const int h = sz(dy), w = sz(dx);

    vector<vector<int>> pref(h + 1, vector<int>(w + 1));
    for (auto [y, x] : p) {
        pref[y + 1][x + 1]++;
    }
    rng(i, 1, h + 1) {
        rng(j, 1, w + 1) {
            pref[i][j] += pref[i - 1][j] + pref[i][j - 1] - pref[i - 1][j - 1];
        }
    }

    int ans = 1;
    rep(i, n) {
        rng(j, i, n) {
            int y1 = p[i].f + 1, x1 = min(p[i].s, p[j].s) + 1;
            int y2 = p[j].f + 1, x2 = max(p[i].s, p[j].s) + 1;

            int left = pref[y2][x1 - 1] - pref[y1 - 1][x1 - 1];
            int right = pref[y2][w] - pref[y2][x2] - pref[y1 - 1][w] + pref[y1 - 1][x2];

            ans += (left + 1) * (right + 1);
        }
    }
    cout << ans << '\n';
}

int32_t main() {
    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    int tc = 1;
    // cin >> tc;
    while (tc--) {
        solve();
    }

    return 0;
}

